/* Function  structure for function  `f_terbilang` */

/*!50003 DROP FUNCTION IF EXISTS `f_terbilang` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `f_terbilang`(`angka` BIGINT) RETURNS text CHARSET utf8
BEGIN
    DECLARE v_result TEXT;
    CALL p_terbilang(angka, v_result);
    RETURN REPLACE(v_result,'  ',' ');
END */$$
DELIMITER ;

/* Procedure structure for procedure `p_terbilang` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_terbilang` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_terbilang`(IN `angka` BIGINT, OUT `retval` TEXT)
BEGIN
  
    DECLARE tmp1 TEXT;
    DECLARE tmp2 TEXT;
     
    SET max_sp_recursion_depth := 20;
 
    IF(angka = 0) THEN
        SET retval = '';
  ELSEIF(angka < 12) THEN
        SET retval = ELT(angka,'satu','dua','tiga','empat','lima','enam','tujuh','delapan','sembilan','sepuluh','sebelas');
  ELSEIF (angka < 20) THEN
        CALL p_terbilang((angka-10),tmp1);
        SET retval = CONCAT(tmp1,' belas');
  ELSEIF (angka < 100) THEN
        CALL p_terbilang(FLOOR(angka/10),tmp1);
        CALL p_terbilang((angka%10),tmp2);
        SET retval = CONCAT(tmp1,' puluh ',tmp2);
  ELSEIf (angka < 200) THEN
        CALL p_terbilang((angka-100),tmp1);
        SET retval = CONCAT('seratus ',tmp1);
  ELSEIF (angka < 1000) THEN
        CALL p_terbilang(FLOOR(angka/100),tmp1);
        CALL p_terbilang((angka%100),tmp2);
        SET retval = CONCAT(tmp1,' ratus ',tmp2);
  ELSEIF (angka < 2000) THEN
        CALL p_terbilang((angka-1000),tmp1);
        SET retval = CONCAT('seribu ',tmp1);
  ELSEIF (angka < 1000000) THEN
        CALL p_terbilang(FLOOR(angka/1000),tmp1);
        CALL p_terbilang((angka%1000),tmp2);
        SET retval = CONCAT(tmp1,' ribu ',tmp2);
  ELSEIF (angka < 1000000000) THEN
        CALL p_terbilang(FLOOR(angka/1000000),tmp1);
        CALL p_terbilang((angka%1000000),tmp2);
        SET retval = CONCAT(tmp1,' juta ',tmp2);
  ELSEIF (angka < 1000000000000) THEN
        CALL p_terbilang(FLOOR(angka/1000000000),tmp1);
        CALL p_terbilang((angka%1000000000),tmp2);
        SET retval = CONCAT(tmp1,' milyar ',tmp2);
  ELSE SET retval = 'GIA';
  END IF;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_automatic_update_doklengkap` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_automatic_update_doklengkap` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_automatic_update_doklengkap`()
BEGIN
    update klaim set id_status_klaim = 2
    where id_status_klaim = 6
        and id in (select a.id
        from klaim a inner join dokklaim b on a.id = b.id_klaim
        where a.id_status_klaim = 6 and a.id_jenisklaim = 1
            and ifnull(dok_surat_pengajuan_klaim,'') <> '' and ifnull(dok_copy_polis,'') <> '' and ifnull(dok_surat_pernyataan_kesehatan,'') <> '' and ifnull(dok_kartu_keluarga_peserta,'') <> '' and ifnull(dok_ktp_peserta,'') <> '' and ifnull(dok_copy_perjanjian_kredit,'') <> '' and ifnull(dok_copy_loan_inquiry,'') <> '' and ifnull(dok_surat_kematian,'') <> '' and ifnull(dok_laporan_kerugian,'') <> '' and ifnull(dok_fk_01_02,'') <> '' and ifnull(dok_kronologis_klaim,'') <> '' and ifnull(dok_surat_keterangan_ahli_waris,'') <> '' and ifnull(dok_kartu_keluarga_ahli_waris,'') <> '' and ifnull(dok_ktp_ahli_waris,'') <> '' and ifnull(dok_copy_sim_peserta,'') <> ''
        union all
        select a.id
        from klaim a inner join dokklaim b on a.id = b.id_klaim
        where a.id_status_klaim = 6 and a.id_jenisklaim in (2,3)
        and ifnull(dok_surat_pengajuan_klaim,'') <> '' and ifnull(dok_copy_polis,'') <> '' and ifnull(dok_surat_pernyataan_kesehatan,'') <> '' and ifnull(dok_kartu_keluarga_peserta,'') <> '' and ifnull(dok_ktp_peserta,'') <> '' and ifnull(dok_copy_perjanjian_kredit,'') <> '' and ifnull(dok_copy_loan_inquiry,'') <> '' and ifnull(dok_sk_pengangkatan,'') <> '' and ifnull(dok_sk_phk_paw,'') <> '' 
        union all
        select a.id
        from klaim a inner join dokklaim b on a.id = b.id_klaim
        where a.id_status_klaim = 6 and a.id_jenisklaim in (4)
        and ifnull(dok_surat_pengajuan_klaim,'') <> '' and ifnull(dok_copy_polis,'') <> '' and ifnull(dok_surat_pernyataan_kesehatan,'') <> '' and ifnull(dok_kartu_keluarga_peserta,'') <> '' and ifnull(dok_ktp_peserta,'') <> '' and ifnull(dok_copy_perjanjian_kredit,'') <> '' and ifnull(dok_copy_loan_inquiry,'') <> '' and ifnull(dok_surat_keterangan_macet,'') <> '' and ifnull(dok_printout_bi_checking,'') <> '' and ifnull(dok_surat_peringatan,'') 
        );
END */$$
DELIMITER ;

